<?php
session_start();

/* DB config */
$host   = 'localhost';
$dbname = 'yau_auto_database';
$user   = 'root';
$pass   = '';

$loginError = "";

/* connect */
$conn = new mysqli($host, $user, $pass, $dbname);
if ($conn->connect_error) {
    die("DB connect error: " . $conn->connect_error);
}

if ($_SERVER['REQUEST_METHOD'] === 'POST') {

    /* 1. grab input */
    $CusEmail    = $_POST['email']    ?? '';
    $CusPassword = $_POST['password'] ?? '';

    /* 2. query by email (table = customer) */
    $stmt = $conn->prepare("SELECT CusPassword FROM customer WHERE CusEmail = ?");
    $stmt->bind_param("s", $CusEmail);
    $stmt->execute();
    $stmt->store_result();

    if ($stmt->num_rows === 1) {          // email exists
        $stmt->bind_result($dbHash);
        $stmt->fetch();

        /* 3. verify hash */
        if (password_verify($CusPassword, $dbHash)) {
            $_SESSION['user'] = $CusEmail;           // keep user logged in
            header("Location: listCar.php");    // next page
            exit();
        }
    }

    $loginError = "Invalid email or password.";
    $stmt->close();
}

$conn->close();
?>


